import React from "react";
import img1 from './images/logo.png';

const Login = () =>{
    return(
        <div class = "header">
            <center><img src={img1} alt="" width = "250" length = "350" /></center>
            <hr width = "70%"></hr>

        </div>

    )
}
export default Login
